import React from "react";
import { Container, Box } from "@chakra-ui/react";
const Homepage = () => {
  return (
    <Container maxW="xl" centerContent>
      <Box>
        <Text>Talk-A</Text>
      </Box>
    </Container>
  );
};

export default Homepage;
